        public static int gcd(int a, int h)
        {
            int temp;
            while(true)
            {
                temp = a % h;
                if (temp == 0) return h;

                a = h;
                h = temp;
            }
        }

        public static double[][] generateKeys(int p, int q)
        {
            int n = p * q;
            int e = 2;
            int phi = (p - 1) * (q - 1);
            while(e < phi)
            {
                if (gcd(e, phi) == 1) break;
                else e++;
            }

            int k = 2;
            double d = (1 + k * phi) / e;

            return new double [][] { new double[] { e, n }, new double[] { d, n } };
        }


        public static string Encrypt(byte[] buffer)
        {
            double[][] Keys = generateKeys(3, 7);
            string result = "";
            for(int i = 0; i < buffer.Length; i++)
            {
                int xCell = buffer[i];
                string yCell = xCell.ToString();
                string CR = "";
                foreach (char item in yCell)
                {
                    int number;
                    int.TryParse(item.ToString(), out number);
                    CR += (Math.Pow(number, Keys[0][0]) % Keys[0][1]).ToString() + (yCell.Length > 1 ? "-" :"");
                }

                result += CR + "_";
                CR = "";  
            }

            return result;
        }

        public static byte[] Decrypt(string chipertext)
        {
            double[][] Keys = generateKeys(3, 7);
            string[] Arr = chipertext.Split('_');
            
            string rCell = "";
            for (int i = 0; i < Arr.Length;i++)
            {
                string[] subArr = Arr[i].Split('-');
                
                foreach(string subItem in subArr)
                {
                    if (subItem == "") continue;
                    int xRow = Convert.ToInt32(subItem);
                    rCell += (Math.Pow(xRow, Keys[1][0]) % Keys[1][1]).ToString();
                    
                }
                rCell += '-';
            }

            string[] arrX = rCell.Split('-');
            byte[] result = new byte[arrX.Length];

            for (int i = 0;  i < arrX.Length - 2;i++)
            {
                result[i] = Convert.ToByte(arrX[i]);
            }

            return result;
        }




